pragma solidity ^0.8.2;
pragma experimental ABIEncoderV2;

//SPDX-License-Identifier: UNLICENSED

contract Gamebreaker {
    event LastBlockTimestamp(uint blockTimestamp);

    function Gamebreak() public {
        uint blockTimestamp = block.timestamp;
        emit LastBlockTimestamp(blockTimestamp);
    }
}
